import React from "react";

export default function search() {
    return (
        <div className="search">
            <form name="searchBox" target="http://127.0.0.1:8000/there-will-be-blood" method="POST">
                <input type="text" placeholder="Search for a movie" className="searchbar" id="searchbar" />
            </form>
        </div>
    );
}
